INSERT INTO `game_info` VALUES (6878850439647854592,'test-4','Anime Trivia a',35,NULL,0,1,35,149293855324246016,2,10,1,0,0,'tealjdslkfjasdf asdf asdfas dfas fasd fasdf asdf b','asdfasdfsa c',1,NULL,'GPJBB8.jpg',NULL,NULL,0,3,'2024-05-06 14:16:51','2021-12-21 00:15:47'),(6887818848595083264,'test-game-1','Test Game 1',66,NULL,0,1,66,149293855324246016,2,2,0,2,2,'asdfasdf','##### Gameplay\n\n> this is my game \n\n[![IMAGE ALT TEXT HERE](http://img.youtube.com/vi/n95SqDyn8UM/0.jpg)](http://www.youtube.com/watch?v=n95SqDyn8UM)\n\n| 1 | 2 | 3 |\n| --- | --- | --- | \n| hello | world | again |\n| a | b | c |\n| d | e | f |\n\n| Tables        | Are           | Cool  |\n| ------------- |:-------------:| -----:|\n| col 3 is      | right-aligned | $1600 |\n| col 2 is      | centered      |   $12 |\n| zebra stripes | are neat      |    $1 |\n\nThis `let test = 2;`  is an inline-snippet.\n\n```\n//This is code editor\nlet test = 1;\ntest += 2;\nconsole.log(test);\n```\n\nTest link at [GitHub Pages](https://pages.github.com/)\n\n**Tic-tac-toe** is *played* on a `three-by-three` grid by two players, who alternately place the marks X and O in one of the nine spaces in the ~grid~.\n\nIn the following example, the first player (X) wins the game in seven steps:\n\nGame of Tic-tac-toe, won by X\nThere is no universally-agreed rule as to who plays first, but in this article the convention that X plays first is used.\n\nPlayers soon discover that the best play from both parties leads to a draw. Hence, tic-tac-toe is often played by young children who may not have discovered the optimal strategy.\n\nBecause of the simplicity of tic-tac-toe, it is often used as a pedagogical tool for teaching the concepts of good sportsmanship and the branch of artificial intelligence that deals with the searching of game trees. It is straightforward to write a computer program to play tic-tac-toe perfectly or to enumerate the 765 essentially different positions (the state space complexity) or the 26,830 possible games up to rotations and reflections (the game tree complexity) on this space.[1] If played optimally by both players, the game always ends in a draw, making tic-tac-toe a futile game.[2]\n\n\nIncidence structure for tic-tac-toe\nThe game can be generalized to an m,n,k-game, in which two players alternate placing stones of their own color on an m-by-n board with the goal of getting k of their own color in a row. Tic-tac-toe is the 3,3,3-game.[3] Harary\'s generalized tic-tac-toe is an even broader generalization of tic-tac-toe. It can also be generalized as an nd game, specifically one in which n equals 3 and d equals 2.[4] It can be generalised even further by playing on an arbitrary incidence structure, where rows are lines and cells are points. Tic-tac-toe\'s incidence structure consists of nine points, three horizontal lines, three vertical lines, and two diagonal lines, with each line consisting of at least three points.',1,'0','JCKLNG.png',NULL,NULL,0,3,'2024-05-25 00:16:02','2022-01-14 18:13:02'),(6887819376221749248,'test-game-2','Test Game 2',4,NULL,0,1,4,149293855324246016,2,2,0,NULL,0,'asdfasdf ','asdfasdfasd',0,'0','KJRWLB.png',NULL,NULL,0,3,'2022-02-26 06:13:20','2022-01-14 18:15:08'),(6908624671466323968,'test-game-3','Test Game 3',115,NULL,0,1,115,149293855324246016,1,1,1,0,0,'test game 3','asdfasdf',0,'0','7FND8W.png',NULL,NULL,0,3,'2024-02-07 05:02:14','2022-03-13 04:07:57');
